Pitanje za ljude koji su rje≈°avali sudoku: gdje ste povecavali broj iteracija?

Ja sam rjesavao backtrackingom kojeg sam poboljsa sa "fill by rejecetion" metodama izmedu svakog poszivanja i sad mi daje error na edgaru da imam premalo iteracija i da varam, pa me zanima kako brojit to.

![](assets/2021-01-17/00026.png)

Kod ide ovako za solver - backtracking (izrezani dijelovi koji ne smatram bitnima za brojanje iteracija): 

```
solver(field sudoku){
        iters++;
        int row = 0, col = 0;
        // nadi praznu lokaciju ili prekini jer vise nema praznih
        // na praznoj lokaciji probaj umetnit brojeve od 1 do 9
        for (int num = 1; num <= 9; num++) {
            if (isValid(sudoku, row, col, num)) {
                // ako mozes ubacit broj na prazno polje, prvo kopiraj stanje polja za cuvanje
                // ubaci broj
                sudoku[row][col] = num;
                // sad pokusaj popunit ostatak odbacivanjem
                FBR(sudoku);
                if (solver(sudoku))
                    return true;                    
                // ako ne uspije, vrati polje na pocetno
            }
        }
        return false;
}
```

Kod za fill by rejection metodu

```
void FBR(int sudoku[][9]) {
        bool changed;
        do {
            iters++;          
            changed = false;
            // probaj svako polje popunit odbacivanjem
            for (int i = 0; i < 9; i++) {
                for (int j = 0; j < 9; j++) {
                    if (sudoku[i][j] == -1) {
                        // ako je uspjesno popunjeno bar jedno polje,
                        //  probaj ispocetka kad zavrsis s ovim popunjavanjem
                        if (fillByRejection(sudoku, i, j)) {
                            changed = true;
                        }
                    }
                }
            }
        } while (changed);
    }
```

Prema njihovoj definiciji `int getBacktraceCalls();` : 
- vraƒáa broj iteracija potrebnih za rje≈°avanje kri≈æaljke. Ukoliko koristite algoritam na praƒáenje unatrag (backtracing), ovo je broj svih rekurzivnih poziva. Ukoliko koristite obiƒçne iteracije, ovo je ukupni broj iteracija.

